@supports (grid-row-start: auto) {
  dl.grid { gap: 1rem; display: grid; grid-template-columns: max-content; grid-template-rows: 1fr; }
  dl.grid dd + dt, dl.grid dt + dd, dl.grid dd + dd { margin-block-start: 0px; }
  dl.grid dt { grid-column: 1 / 2; }
  dl.grid dd { grid-column: 2 / 3; margin-inline-start: 0px; }
}

@media screen {
  .table-wrap { border: 1px solid rgb(202, 201, 201); margin-bottom: 1rem; margin-top: 1rem; max-width: 100% !important; }
  .table-wrap[role][aria-labelledby][tabindex] { overflow: auto; }
  .table-wrap table { border: 0px; margin-bottom: 0px; margin-top: 0px; }
  .table-wrap:focus { border-color: rgb(0, 0, 0); box-shadow: 0px 0px 0px 4px inset; outline: rgb(249, 220, 74) solid 3px; }
}

@media screen {
  #archive-banner { background-color: rgb(249, 220, 74); padding-bottom: 1.25rem; padding-top: 1.25rem; }
  #archive-banner .centered { box-sizing: content-box; margin-left: auto; margin-right: auto; max-width: 70rem; overflow: hidden; padding-left: 5vw; padding-right: 5vw; }
  #archive-banner .centered > * { display: flex; flex-flow: wrap; margin: -0.75rem; }
  #archive-banner .centered > * > * { margin: 0.75rem; }
  #archive-banner .archive-banner__message { flex-basis: 0px; flex-grow: 999; min-width: calc(80% - 1.5rem); }
  #archive-banner .archive-banner__message > * + * { margin-top: 1rem; }
  #archive-banner .archive-banner__message > * { max-width: 41.25rem; }
  #archive-banner .archive-banner__message h2 { display: block; font-size: 1.1875rem; line-height: 1.68421; }
  #archive-banner .archive-banner__message h3 { font-size: 1rem; line-height: 1.33333; }
  #archive-banner .archive-banner__message h3 + * { margin-top: 0px; }
  #archive-banner a, #archive-banner .heading-anchor { color: rgb(2, 68, 136); }
  #archive-banner a:visited, #archive-banner .heading-anchor:visited { color: rgb(2, 68, 136); }
  #archive-banner a:focus, #archive-banner .heading-anchor:focus { background-image: none; color: rgb(0, 0, 0); outline: rgb(0, 0, 0) solid 2px; outline-offset: 1px; text-decoration: none; }
  #archive-banner .archive-banner__logo { flex-basis: auto; flex-grow: 1; order: -1; }
  #archive-banner .archive-banner__logo > span { display: block; height: 2.75rem; position: relative; width: 4.125rem; }
}

@media print {
  #archive-banner { border: 2.25pt solid; font-family: "Noto Sans", "Trebuchet MS", Geneva, sans-serif; margin: 1cm; padding: 8pt; position: relative; }
  #archive-banner a:link, #archive-banner a:visited, #archive-banner a, #archive-banner .heading-anchor { color: rgb(0, 0, 0); }
  #archive-banner a[href]::after, #archive-banner [href].heading-anchor::after { content: " <" attr(href) "> "; }
  .archive-banner__message { min-height: 40pt; padding-left: 62pt; }
  .archive-banner__message > * + * { margin-top: 8pt; }
  [dir="rtl"] .archive-banner__message { padding-left: 0px; padding-right: 60pt; }
  .archive-banner__logo { left: 8pt; position: absolute; top: 8pt; }
  [dir="rtl"] .archive-banner__logo { left: auto; right: 8pt; }
}

